import * as React from 'react';
import './dropdown.scss';

type DropDownProps = {
  submenus: {
    title: string;
  }[];
};

const Dropdown: React.FC<DropDownProps> = ({ submenus }) => {
  return (
    <ul className={'dropdown-wrapper'}>
      {submenus.map(({ title }) => (
        <li key={title}>
          <a href="/#">{title}</a>
        </li>
      ))}
    </ul>
  );
};

export { Dropdown };
